import './App.css';

function App() {
  return (

    <div class="App ui raised very padded text container segment" >
      <div class="ui center aligned container">
        <i class="huge circular users icon"></i>
        <h2 class="ui header">Iniciar sesión</h2>
      </div>

      <form class="ui form">
        <div class="field">
          <label>Nombre usuario</label>
          <input type="text" name="first-name" placeholder="Ingrese nombre usuario" />
        </div>
        <div class="field">
          <label>Contraseña</label>
          <input type="text" name="last-name" placeholder="Ingrese contraseña" />
        </div>

        <button class="ui button" type="submit">Submit</button>
      </form>
    </div >
  );
}

export default App;
